<div class="circle-animation-container" x-data="circleAnimation" x-init="init()">
    <style>
        .circle-animation-container svg path {
            opacity: 0
        }

        @keyframes popIn {
            0% {
                transform: scale(0)translateZ(0);
                opacity: 0
            }

            50% {
                transform: scale(1.1)translateZ(0)
            }

            100% {
                transform: scale(1)translateZ(0);
                opacity: 1
            }
        }

        @keyframes gentleFloat {
            0%,100% {
                transform: translate3d(0,0,0)scale(1)
            }

            50% {
                transform: translate3d(0,calc(var(--float-distance) * -1px),0)scale(var(--float-scale))
            }
        }

        .circle-pop {
            animation: popIn var(--duration)cubic-bezier(.4,0,.2,1)forwards,gentleFloat var(--float-duration)cubic-bezier(.45,0,.55,1)var(--float-delay)infinite;
            transform-origin: center;
            opacity: 0;
            will-change: transform,opacity;
            backface-visibility: hidden;
            -webkit-backface-visibility: hidden;
            --duration: 0.8s;
            --float-distance: 2;
            --float-scale: 1.02;
            --float-duration: 4s;
            --float-delay: 0s
        }
    </style>
    <style>
        @keyframes gentleFloat {
            0%,100% {
                transform: translateY(0)
            }

            50% {
                transform: translateY(-3px)
            }
        }
    </style>

    <script defer src="https://cdn.jsdelivr.net/npm/alpinejs@3.x.x/dist/cdn.min.js"></script>
    <script>
        document.addEventListener("alpine:init", () => {
            Alpine.data("circleAnimation", () => ({
                init() {
                    this.$nextTick( () => {
                        const e = this.$el.querySelector("svg")
                            , t = e.querySelectorAll("path");
                        if (!t.length)
                            return;
                        const n = e.getAttribute("viewBox");
                        if (n) {
                            const [s,o,i,a] = n.split(" ").map(Number)
                                , t = 3
                                , r = `${s} ${o - t} ${i} ${a + t * 2}`;
                            e.setAttribute("viewBox", r)
                        }
                        t.forEach( (e) => {
                            e.classList.add("circle-pop");
                            const o = Math.random()
                                , n = Math.pow(o, 1.5) * 2500;
                            e.style.animationDelay = `${n}ms`,
                            e.style.transform = "translateZ(0)";
                            const s = .6 + Math.random() * .4;
                            e.style.setProperty("--duration", `${s}s`),
                            e.style.transformOrigin = "center";
                            const i = n + s * 1e3 + Math.random() * 2e3
                                , a = 3 + Math.random() * 2
                                , r = 1 + Math.random() * 2
                                , c = 1.01 + Math.random() * .02;
                            e.style.setProperty("--float-delay", `${i}ms`),
                            e.style.setProperty("--float-duration", `${a}s`),
                            e.style.setProperty("--float-distance", r),
                            e.style.setProperty("--float-scale", c)
                        }
                        )
                    }
                    )
                }
            }))
        }
        )
    </script>
